import Lab from './Lab'


let labs = [
  {
    name: 'Lab1',

  },
  {
    name: 'Lab2',

  },
  {
    name: 'Lab3',

  },
]
const Labs = () => {

  return (
    <div>
            <Grid container spacing={2}>
        {members.map((member) => {
          return (
            <Grid item xs={12} sm={6} md={4}>
              <TeamMember key={member.name} member={member} avatar={member.avatar}></TeamMember>
            </Grid>
          )
          })}
      </Grid>
      {labs.map((lab) => <Lab key={lab.name} lab={lab} />)}
    </div>
  )
}

export default Labs
